Today in history: 
On December 25, 1991, the Soviet Union collapsed; 
On December 25, 1989, Nicolae Ceausescu of Romania was executed.

As New Year's Day is approaching, many places across the country have issued notices that "there will be no New Year's Eve activities in business districts":
Jiangsu: Nanjing Xinjiekou and Jiangning Department Store business districts will not organize New Year's Eve countdown activities, encourage people not to gather, and not sell balloons; it is prohibited to set off firecrackers and Kongming lanterns;
Hunan: Changsha Wuyi business district will have no New Year's Eve activities;
Guangdong: Guangzhou Tower, Taikoo Wharf and other places will have no large-scale activities.
